mapper.select:
select DDC_SUBTASK_EXECUTE_HISTORY.EXECUTE_ID, DDC_SUBTASK_EXECUTE_HISTORY.WORKFLOW_EXECUTE_ID, DDC_SUBTASK_EXECUTE_HISTORY.TASK_ID, EXECUTE_BATCH_ID, DDC_SUBTASK_EXECUTE_HISTORY.WORKFLOW_ID, TRIGGER_TYPE, FIRE_TIME, SHOULD_FIRE_TIME, ACTUAL_FIRE_TIME, DISPATCH_TIME, DISPATCH_COUNT, RECEIVE_TIME, START_TIME, COMPLETE_TIME, DDC_SUBTASK_EXECUTE_HISTORY.TIMEOUT, DDC_SUBTASK_EXECUTE_HISTORY.TIMEOUT_TIME, DDC_SUBTASK_EXECUTE_HISTORY.TIMEOUT_RETRY, DDC_SUBTASK_EXECUTE_HISTORY.TIMEOUT_RETRY_TIMES, IP, PORT, NODE_CODE, EXECUTE_RESULT, EXECUTE_RESULT_DESC,DDC_TASK.TASK_NAME,DDC_TASK.CLASS_NAME,DDC_TASK.TASK_TYPE
ORDER BY DDC_SUBTASK_EXECUTE_HISTORY.DISPATCH_TIME DESC
limit #{page.begin},#{page.length}

mapper.sql:
from DDC_SUBTASK_EXECUTE_HISTORY LEFT JOIN DDC_TASK on DDC_SUBTASK_EXECUTE_HISTORY.TASK_ID = DDC_TASK.TASK_ID

  
    and FIRE_TIME BETWEEN #{beginTime} AND #{endTime}
  
  
    
      AND APP_ID = #{task.appId}
    
    
      AND DDC_SUBTASK_EXECUTE_HISTORY.TASK_ID = #{task.taskId}
    
    
      AND DDC_TASK.TASK_TYPE = #{task.taskType}
    
    
      AND DDC_TASK.TASK_NAME LIKE CONCAT("%",#{task.taskName},"%")
    
    
      AND DDC_TASK.CLASS_NAME LIKE CONCAT("%",#{task.className},"%")
    
  
  
    AND DDC_SUBTASK_EXECUTE_HISTORY.EXECUTE_RESULT = #{executeResult}
  
  
    AND DDC_SUBTASK_EXECUTE_HISTORY.WORKFLOW_EXECUTE_ID = #{workflowExecuteId}
